import React, { Component } from 'react';
import {Table, Label} from 'semantic-ui-react';
class Requestrow extends Component{
    constructor(props){
        super(props);
    }
    render(){
        return(
            <Table.Body>
                <Table.Row>
                <Table.Cell>
                 <Label>{this.props.key}</Label>
                </Table.Cell>
                <Table.Cell>
                 <Label>{this.props.request.description}</Label>
                </Table.Cell>
                <Table.Cell>
                 <Label>{this.props.key}</Label>
                </Table.Cell>
                <Table.Cell>
                 <Label>{this.props.key}</Label>
                </Table.Cell>
                <Table.Cell>
                 <Label>{this.props.key}</Label>
                </Table.Cell>
            </Table.Row>
            </Table.Body>   
        );
    }
}
export default Requestrow;
